import{_ as e,o,c as t,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 56-1.3 Regulation of Voice-over-Internet protocol service.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-1.3.md","filePath":"vacode/56-1.3.md"}'),i={name:"vacode/56-1.3.md"},n=r('<h1 id="§-56-1-3-regulation-of-voice-over-internet-protocol-service" tabindex="-1">§ 56-1.3 Regulation of Voice-over-Internet protocol service. <a class="header-anchor" href="#§-56-1-3-regulation-of-voice-over-internet-protocol-service" aria-label="Permalink to &quot;§ 56-1.3 Regulation of Voice-over-Internet protocol service.&quot;">​</a></h1><p>Notwithstanding any provision of law, except § <a href="/vacode/58.1-1730/">58.1-1730</a>, to the contrary:</p><ol><li><p>&quot;Telecommunications service&quot; and &quot;telephone service&quot; shall not include the provision of Voice-over-Internet protocol service for purposes of regulation by the Commission.</p></li><li><p>The Commission shall not have jurisdiction with respect to the regulation of Voice-over-Internet protocol service, including but not limited to the imposition of regulatory fees, certification requirements, and the filing or approval of tariffs.</p></li><li><p>Nothing herein shall be construed to either mandate or prohibit the payment of switched network access rates or other intercarrier compensation, if any, related to Voice-over-Internet protocol service, as may be determined by the Commission.</p></li></ol><p>2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0691" target="_blank" rel="noreferrer">691</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0532" target="_blank" rel="noreferrer">532</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0533" target="_blank" rel="noreferrer">533</a>.</p>',4),a=[n];function c(l,s,p,h,f,v){return o(),t("div",null,a)}const u=e(i,[["render",c]]);export{_ as __pageData,u as default};
